import React,{Fragment} from "react"
import Playcover from "../static/css/playcover.module.css"
export default function PlayCover(){
    return(
        <Fragment>
            <div id={Playcover.wrap}>
                <span className={Playcover.cover,playcover.frist}></span>
                <span className={Playcover.cover,playcover.second}></span>
                <span className={Playcover.cover,playcover.third}></span>
            </div>
        </Fragment>
    )
}
